def overkill_count(a, b):
    """–†–µ—à–µ–Ω–∏–µ –ø–µ—Ä–µ–±–æ—Ä–æ–º."""
    c = 0
    for i in range(a, b+1):
        if i % 2 == 1:
            c = c + 1
    return c

def smart_count(a, b):
    """–†–µ—à–µ–Ω–∏–µ –ø–æ —Ñ–æ—Ä–º—É–ª–µ."""

    # –Ω–∞–π–¥–µ–º –ø–µ—Ä–≤–æ–µ –Ω–µ—á–µ—Ç–Ω–æ–µ —á–∏—Å–ª–æ, –±–æ–ª—å—à–µ –∏–ª–∏ —Ä–∞–≤–Ω–æ–µ "a"
    if a % 2 == 1:
        a = a
    else:
        a = a + 1

    # –Ω–∞–π–¥–µ–º –ø–µ—Ä–≤–æ–µ –Ω–µ—á–µ—Ç–Ω–æ–µ —á–∏—Å–ª–æ, –º–µ–Ω—å—à–µ–µ –∏–ª–∏ —Ä–∞–≤–Ω–æ–µ "b"
    if b % 2 == 1:
        b = b
    else:
        b = b - 1

    # —Ç–µ–ø–µ—Ä—å a –∏ b - –º–∏–Ω–∏–º–∞–ª—å–Ω–æ–µ –∏ –º–∞–∫—Å–∏–º–∞–ª—å–Ω–æ–µ –Ω–µ—á–µ—Ç–Ω—ã–µ —á–∏—Å–ª–∞ –≤–Ω—É—Ç—Ä–∏ –æ—Ç—Ä–µ–∑–∫–∞
    # –∏—Ö —Ä–∞–∑–Ω–æ—Å—Ç—å –¥–µ–ª–∏—Ç—Å—è –Ω–∞ 2
    # –∏ –Ω—É–∂–Ω–æ –ø—Ä–∏–±–∞–≤–∏—Ç—å 1
    return (b-a)//2 + 1

# –ø–µ—Ä–µ–±–µ—Ä–µ–º –∫—É—á—É "a" –∏ "b", —á—Ç–æ–±—ã —Å—Ä–∞–≤–Ω–∏—Ç—å –¥–≤–∞ —Ä–µ—à–µ–Ω–∏—è –¥–ª—è —Ä–∞–∑–Ω—ã—Ö –∏—Å—Ö–æ–¥–Ω—ã—Ö –¥–∞–Ω–Ω—ã—Ö
for a in range(0, 10):
    for b in range(a, 20):
        if smart_count(a, b) != overkill_count(a, b):
            # –µ—Å–ª–∏ –¥–≤–∞ —Ä–µ—à–µ–Ω–∏—è –Ω–µ —Å–æ–≤–ø–∞–¥–∞—é—Ç - —ç—Ç–æ –ø—Ä–æ–±–ª–µ–º–∞
            print(f"problem with {a} and {b}")
        else:
            # —Ä–∞—Å–ø–µ—á–∞—Ç–∞–µ–º —Ä–µ–∑—É–ª—å—Ç–∞—Ç
            print(a, b, smart_count(a, b))

