#include <string>
#include <iostream>
#include <limits>
#include <vector>

using namespace std;

template<typename T>
T input(istream& inp, const char* prompt) {
    cout << prompt;
    T value{};
    inp >> value;
    inp.ignore(0x1000, '\n');
    return value;
}

template<>
string input(istream& inp, const char* prompt) {
    cout << prompt;
    string value;
    getline(inp, value);
    return value;
}

struct Student {
    string name;
    char gender;
    short course;
    float height;
    short mathematics;
    short physics;
    short informatics;
    short chemistry;
    short economy;
    Student() :
        gender(' '),
        course(0),
        height(0.0),
        mathematics(0),
        physics(0),
        informatics(0),
        chemistry(0),
        economy(0) {}
    bool is_same_height(const Student& student) const {
        return height == student.height;
    }
private:
    friend istream& operator>>(istream& inp, Student& student) {
        student.name = input<string>(inp, "–§–∞–º–∏–ª–∏—è: ");
        student.gender = input<char>(inp, "–ü–æ–ª (–º –∏–ª–∏ –∂): ");
        student.course = input<short>(inp, "–ö—É—Ä—Å: ");
        student.height = input<float>(inp, "–†–æ—Å—Ç: ");
        student.mathematics = input<short>(inp, "–û—Ü–µ–Ω–∫–∞ –ø–æ –º–∞—Ç–µ–º–∞—Ç–∏–∫–µ: ");
        student.physics = input<short>(inp, "–û—Ü–µ–Ω–∫–∞ –ø–æ —Ñ–∏–∑–∏–∫–µ: ");
        student.informatics = input<short>(inp, "–û—Ü–µ–Ω–∫–∞ –ø–æ –∏–Ω—Ñ–æ—Ä–º–∞—Ç–∏–∫–µ: ");
        student.chemistry = input<short>(inp, "–û—Ü–µ–Ω–∫–∞ –ø–æ —Ö–∏–º–∏–∏: ");
        student.economy = input<short>(inp, "–û—Ü–µ–Ω–∫–∞ –ø–æ —ç–∫–æ–Ω–æ–º–∏–∫–µ: ");
        return inp;
    }
};

class Students {
public:
    Students(const size_t length) {
        table.resize(length);
    }
    bool is_man() const {
        for (const auto& student : table) {
            if (student.gender == '–º') {
                return true;
            }
        }
        return false;
    }
    Student tallest_man() const {
        Student sample;
        for (const auto& student : table) {
            if (student.gender == '–º' && sample.height < student.height) {
                sample = student;
            }
        }
        return sample;
    }
    Student shortest_man() const {
        Student sample;
        sample.height = numeric_limits<float>::max();
        for (const auto& student : table) {
            if (student.gender == '–º' && student.height < sample.height) {
                sample = student;
            }
        }
        return sample;
    }
    double average_height_of_men() const {
        auto sum = 0.0;
        auto quantity = 0U;
        for (const auto& student : table) {
            if (student.gender == '–º') {
                sum += student.height;
                ++quantity;
            }
        }
        return sum / quantity;
    }
private:
    vector<Student> table;
    friend istream& operator>>(istream& inp, Students& students) {
        for (auto& student : students.table) inp >> student;
        return inp;
    }
};

int main() {
    system("chcp 1251 > nul");
    const auto n = input<size_t>(cin, "–ö–æ–ª–∏—á–µ—Å—Ç–≤–æ —Å—Ç—É–¥–µ–Ω—Ç–æ–≤: ");
    Students students(n);
    cin >> students;
    if (!students.is_man()) puts("–ú—É–∂—á–∏–Ω –Ω–µ –Ω–∞–π–¥–µ–Ω–æ!");
    else {
        auto high = students.tallest_man();
        auto low = students.shortest_man();
        if (high.is_same_height(low)) puts("–í—Å–µ –º—É–∂—á–∏–Ω—ã –æ–¥–∏–Ω–∞–∫–æ–≤–æ–≥–æ —Ä–æ—Å—Ç–∞");
        else {
            cout.setf(ios::fixed);
            cout.precision(1);
            auto avg = students.average_height_of_men();
            cout << "–°—Ä–µ–¥–Ω–∏–π —Ä–æ—Å—Ç —Å—Ç—É–¥–µ–Ω—Ç–æ–≤ –º—É–∂—Å–∫–æ–≥–æ –ø–æ–ª–∞: " << avg << '\n';
            cout << "–°–∞–º—ã–π –≤—ã—Å–æ–∫–∏–π: " << high.name << ", –µ–≥–æ —Ä–æ—Å—Ç: " << high.height << '\n';
            cout << "–°–∞–º—ã–π –Ω–∏–∑–∫–∏–π: " << low.name << ", –µ–≥–æ —Ä–æ—Å—Ç: " << low.height << '\n';
        }
    }
    system("pause > nul");
}

CREATE OR REPLACE FUNCTION csharp.migrate_call_numbers(source_ou INT, dest_ou INT) RETURNS INT AS $func$
DECLARE
    source_org  actor.org_unit%ROWTYPE;
    dest_org    actor.org_unit%ROWTYPE;
    source_cn   asset.call_number%ROWTYPE;
    target_cn   asset.call_number%ROWTYPE;
    hold        action.hold_request%ROWTYPE;

BEGIN

    SELECT INTO source_org *
        FROM actor.org_unit
        WHERE id = source_ou;

    SELECT INTO dest_org *
        FROM actor.org_unit
        WHERE id = dest_ou;

    -- Find call numbers attached to the source org ...
    FOR source_cn IN
        SELECT *
            FROM asset.call_number
            WHERE owning_lib = source_org.id
            AND NOT deleted
    LOOP

    SELECT INTO target_cn *
        FROM  asset.call_number
        WHERE label = source_cn.label
        AND prefix = source_cn.prefix
        AND suffix = source_cn.suffix
        AND owning_lib = dest_org.id
        AND record = source_cn.record
        AND NOT deleted;

    -- ... and if there's a conflicting one on the target ...                                                   
    IF FOUND THEN

            -- ... move the copies to that, and ...                                                             
            UPDATE  asset.copy
              SET   call_number = target_cn.id
              WHERE call_number = source_cn.id;

            -- ... move V holds to the move-target call number                                                  
            FOR hold IN SELECT * FROM action.hold_request WHERE target = source_cn.id AND hold_type = 'V' LOOP

                    UPDATE  action.hold_request
                      SET   target = target_cn.id
                      WHERE id = hold.id;

            END LOOP;

            UPDATE asset.call_number SET deleted = TRUE WHERE id = source_cn.id;

    -- ... if not ...                                                                                           
    ELSE
            -- ... just move the call number to the target org
            UPDATE  asset.call_number
              SET   owning_lib = dest_org.id
              WHERE id = source_cn.id;
    END IF;
    END LOOP;
    RETURN 1;
END;
$func$ LANGUAGE plpgsql;

