#define ROWS 4
#define COLS 5

void fill_matrix(int array[ROWS][COLS]) {
    srand(time(NULL));
    for (int i = 0; i < ROWS; i++) {
        for (int j = 0; j < COLS; j++) {
            array[i][j] = 1 + rand() % 3;
        }
    }
}

void print_matrix(int array[ROWS][COLS]){
    for (int i = 0; i < ROWS; i++){
        for (int j = 0; j < COLS; j++){
            printf("%d ", array[i][j]);
        }
        printf("\n");
    }
}

void find_g(int matrix[ROWS][COLS]){
    int maxCount = 0;
    int coords[] = {0, 0, 0, 0, 0, 0};
    for (int i = 0; i < ROWS; i++){
        for (int j = 0; j < COLS; j++){
            // –í–æ—Ç –æ—Ç—Å—é–¥–∞ –º–æ–∂–Ω–æ –≤—ã–∫–∏–Ω—É—Ç—å –≤—ã—á–∏—Å–ª–µ–Ω–∏–µ —É–≥–æ–ª–æ—á–∫–∞ –∏–∑ —ç—Ç–æ–π —Ç–æ—á–∫–∏ –≤ –æ—Ç–¥–µ–ª—å–Ω—ã–π –ø–æ—Ç–æ–∫
            int k = 0;
            int lengthOfHorizontal = 0; // –°—é–¥–∞ —Å–æ—Ö—Ä–∞–Ω—è–µ–º –¥–ª–∏–Ω—É –ø–æ–≤—Ç–æ—Ä—è—â–∏—Ö—Å—è —Å–∏–º–≤–æ–ª–æ–≤ –≤ —Å—Ç—Ä–æ–∫–µ
            while (j + k < COLS && matrix[i][j + k] == matrix[i][j]){
                lengthOfHorizontal++;
                // –ò–ª–∏ –≤–æ—Ç –æ—Ç—Å—é–¥–∞ –º–æ–∂–Ω–æ –∑–∞–ø—É—Å–∫–∞—Ç—å –ø–æ—Ç–æ–∫–∏, –ø—Ä–æ–≤–µ—Ä—è—é—â–∏–µ –≤–µ—Ä—Ç–∏–∫–∞–ª—å–Ω—ã–µ –ª–∏–Ω–∏–∏ –Ω–∞ —Å–æ–≤–ø–∞–¥–µ–Ω–∏–µ —Å —ç–ª–µ–º–µ–Ω—Ç–æ–º matrix[i][j]
                // –ù–∏–∂–Ω–∏–π —Ü–∏–∫–ª –≤—ã–∫–∏–Ω—É—Ç—å –≤ –æ—Ç–¥–µ–ª—å–Ω—ã–π –ø–æ—Ç–æ–∫
                int l = 0;
                int lengthOfVertical = 0; // –°—é–¥–∞ —Å–æ—Ö—Ä–∞–Ω—è–µ–º –¥–ª–∏–Ω—É –ø–æ–≤—Ç–æ—Ä—è—é—â–∏—Ö—Å—è —Å–∏–º–≤–æ–ª–æ–≤ –≤ —Å—Ç–æ–ª–±—Ü–µ
                while (i + l < ROWS && matrix[i + l][j + k] == matrix[i][j + k]){
                    lengthOfVertical++;
                    l++;
                }
                if (lengthOfHorizontal + lengthOfVertical > maxCount){
                    coords[0] = i;
                    coords[1] = j;
                    coords[2] = i;
                    coords[3] = j + k;
                    coords[4] = i + l - 1;
                    coords[5] = j + k;
                    maxCount = lengthOfHorizontal + lengthOfVertical;
//                    coords = {i, j, i, j + k, i + l - 1, j + k};
                }
                k++;
            }
        }
    }
    for (int i = 0; i < 6; i++){
        printf("%d ", coords[i]);
    }
}

